import React from "react";

import "./ProjectPosts.scss"

import ProjectCard from "../../../Pages/Home/HomeComponents/RecentProjects/ProjectCard/ProjectCard"

import { Link } from "react-router-dom";

const ProjectPosts = () => {

    return (
        <div className="home__wrapper">

            <Link to="/projects/benchcalculator">BenchCalculator.com</Link>
            <Link to="/projects/1">1</Link>
            <Link to="/projects/2">2</Link>

        </div>
    )
}

export default ProjectPosts;
